CREATE TABLE InternalStorage(
   id           INTEGER  NOT NULL PRIMARY KEY 
  ,name         VARCHAR(84) NOT NULL
  ,price        NUMERIC(7,2)
  ,capacity     NUMERIC(6,1) NOT NULL
  ,price_per_gb NUMERIC(5,3)
  ,type         VARCHAR(5)
  ,cache        INTEGER 
  ,form_factor  VARCHAR(9) NOT NULL
  ,interface    VARCHAR(15) NOT NULL
);
